#include <iostream>
#include <string>
#include <unordered_map>
using namespace std;

class Solution {
public:
    char findTheDifference(string s, string t) {
        unordered_map<char, int> charCount;
        for (char c : s) {
            charCount[c]++;
        }

        for (char c : t) {
            charCount[c]--;

            if (charCount[c] < 0) {return c;}
        }
        return t[t.length() - 1];
    }
};

int main() {
    string s = "";
    string t = "";
    Solution sol;
    cout << sol.findTheDifference(s, t) << endl;
    return 0;
}